import React from "react"
import styles from "../Styles/Start_A_Project.module.css"

const StartProject = () => {
    return(
        <div>
            <div className={styles.heading}>
                <h1>Build your creative project <br/> to life.</h1>
                <button>Start a project</button>
            </div>
        </div>
    )
}

export {StartProject}
